import Vue from 'vue'
import VueRouter from 'vue-router'

import homePage from '../views/homePage.vue';
import blogPage from '../views/blogPage.vue';
import catagoryPage from '../views/catagoryPage.vue';
import tagPage from '../views/tagPage.vue';
import aboutme from '../views/aboutMePage.vue'
import blogManPage from '../views/blogManPage.vue'
import blogPublishPage from '../views/blogPublishPage.vue'
import login from '../views/loginPage.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/login',
    component: login,
    children:[
      {
        path: '/blogPublishPage',
        component: blogPublishPage
      },
      {
        path: '/blogManPage',
        component: blogManPage
      },
      {
        path:"",
        redirect:"/login"
      }
    ]
  },
  {
    path: '/aboutMe',
    component: aboutme
  },
  {
    path: '/tagPage',
    component: tagPage
  },
  {
    path: '/catagoryPage',
    component: catagoryPage
  },
  {
    path: '/homePage',
    component: homePage
  },
  {
    path: '/homePage/blogPage',
    component: blogPage
  },
  // 重定向
  {
    path: '/', 
    redirect: '/homePage'
  }
]

export default new VueRouter({
  routes
})
